import React from 'react';
import './App.css';
import { HashRouter, Switch, Route, Redirect, NavLink } from 'react-router-dom';
import { Menu } from 'antd';
import {
  MailOutlined,
  AppstoreOutlined,
  SettingOutlined,
  UnorderedListOutlined,
} from '@ant-design/icons';

const { SubMenu } = Menu;
const links = ['Input', 'Task List'];
function App() {
  return (
    <HashRouter>
      <header />
      <nav>
        <div>
          <Menu mode="horizontal">
              <Menu.Item
                className="headerLink"
                key={'Input'}
                to={'Input'}
                icon={<UnorderedListOutlined />}
              >
                {link}
              </Menu.Item>

              <Menu.Item
                className="headerLink"
                key={link}
                to={link}
                icon={<UnorderedListOutlined />}
              >
                {link}
              </Menu.Item>
          </Menu>
        </div>
      </nav>
      <div className="app">
        <Switch>
          <Route render={() => <Redirect to="/Rooms" />} />
        </Switch>
      </div>
    </HashRouter>
  );
}

export default App;
